            "headline": "Measles Cases and Outbreaks",
            "main_text": "CDC updates this page monthly., As of March 5, 2021, there have been no measles cases reported in the U.S., From January 1 to December 31, 2020, 13 individual cases of measles were confirmed in 8 jurisdictions.*, *Jurisdictions refer to any of the 50 states, New York City, and the District of Columbia., 2010-2020*(as of December 31, 2020), *Case count is preliminary and subject to change., Make sure you are vaccinated against measles before traveling internationally., In a given year, more measles cases can occur for any of the following reasons:, For specific information on measles cases in recent years please see the following reports:, Protect Families &amp; Communities with MMR Vaccine pdf icon[1 page, 508], To receive email updates about this page, enter your email address:",
