            "main_text": " New Travel RequirementsAll air passengers coming to the United States, including U.S. citizens, are required to have a negative COVID-19 test result or documentation of recovery from COVID-19 before they board a flight to the United States. See the Frequently Asked Questions for more information.Masks are required on planes, buses, trains, and other forms of public transportation traveling into, within, or out of the United States and in U.S. transportation hubs such as airports and bus or rail stations.Level 2: Moderate Level of COVID-19 in Trinidad and TobagoKey Information for Travelers to Trinidad and TobagoTravel increases your chances of getting and spreading COVID-19. CDC recommends that you do not travel at this time.Travelers at increased risk for severe illness from COVID-19 should avoid all nonessential travel to Trinidad and Tobago.If you must travel:                        Before you travel, get tested with a viral test 1â€“3 days before your trip.                                Do NOT travel if you were exposed to COVID-19, you are sick, or you test positive for COVID-19. Learn when it is safe for you to travel. Don't travel with someone who is sick.Follow all entry requirements for your destination and provide any required or requested health information.If you do not follow your destination's requirements, you may be denied entry and required to return to the United States.During travel, wear a mask, avoid crowds, stay at least 6 feet from people who are not traveling with you, wash your hands often or use hand sanitizer, and watch for symptoms.                                Before traveling back to the United States by air, get tested with a viral test no more than 3 days before your flight departs. The test result must be negative. Keep a copy of your test results with you during travel in case you are asked for them. See Frequently Asked Questions for more information about this requirement. Follow all destination and airline recommendations or requirements.After you travel, get tested 3â€“5 days after travel AND stay home to self-quarantine for 7 days after travel. If you don't get tested, it's safest to stay home to self-quarantine for 10 days. COVID-19 Levels Level 4: Very High Level 3: High Level 2: Moderate Level 1: Low Level unknownLearn more about COVID-19 levels.See all COVID-19 travel notices.Travel and COVID-19Travel increases your chance of getting and spreading COVID-19. Stay home to protect yourself and others from COVID-19. Airports, bus stations, train stations, and rest stops are all places travelers can be exposed to the virus. These are also places where it can be hard to social distance. If you travel, take steps before, during, and after travel to keep yourself and others from getting COVID-19.Before You TravelTalk to your doctor ahead of travel, especially if you are at increased risk for severe illness from COVID-19.If you are eligible, get fully vaccinated for COVID-19. Wait 2 weeks after getting your second vaccine dose to travelâ€”it takes time for your body to build protection after any vaccination.Get tested with a viral test 1â€“3 days before your trip.Do NOT travel if you were exposed to COVID-19, you are sick, or you test positive for COVID-19. Learn when it is safe for you to travel. Donâ€™t travel with someone who is sick.If traveling by air, check if your airline requires any health information, test results, or other documents. Check with your destination's Office of Foreign Affairs or Ministry of Health or the US Department of State, Bureau of Consular Affairs, Country Information page for details about entry requirements and restrictions for arriving travelers. Follow any entry requirements or restrictions at your destination which might include testing, quarantine, and providing contact information. If you do not follow your destination's requirements, you may be denied entry and required to return to the United States. If you test positive on 