r you get tested or not.Follow state and local recommendations or requirements after travel. Also, take these actions after you return from travel to protect others from getting COVID-19:Avoid crowds and stay at least 6 feet/2 meters\u202f(about 2 arm lengths) from anyone who did not travel with you. Itâ€™s important to do this everywhere â€” both indoors and outdoors. Wear a\u202fmask\u202fover your nose and mouth when in public settings. Masks are required on planes, buses, trains, and other forms of public transportation traveling into, within, or out of the United States and in U.S. transportation hubs such as airports and stations.If there are people in the household who did not travel with you,\u202fwear a mask\u202fand ask everyone in the household to wear masks in shared spaces inside your home for 14 days after travel. Wash your hands often or use hand sanitizer with at least 60% alcohol.Avoid being around people who are at increased risk for severe illness.Watch your health: Look for symptoms of COVID-19.See CDC's After You Travel page for more information.Other ConsiderationsIf you get sick with COVID-19 or test positive for the virus that causes COVID-19 while abroad, you might not be permitted to return to the United States until you can end isolation. If you are exposed to someone with COVID-19 during travel, you might be quarantined and not be permitted to return to the United States until your quarantine is lifted.Clinician InformationClinicians should obtain a detailed travel history for patients with symptoms of COVID-19 infection. If you suspect that a traveler has COVID-19, see Information for Healthcare Professionals about Coronavirus (COVID-19) for information on evaluating, reporting, clinical care guidance, and infection control.Additional InformationKnow When Not to Travel to Avoid Spreading COVID-19How CDC Determines the Level of a Destinationâ€™s COVID-19 Travel Health NoticeTravel During COVID-19Testing and International Air TravelCoronav