            "main_text": "When hearing about hepatitis A, many people think about contaminated food and water. However, in the United States, hepatitis A is more commonly spread from person to person. Since March 2017, CDCâ€™s Division of Viral Hepatitis (DVH) has been assisting multiple state and local health departments with hepatitis A outbreaks, spread through person-to-person contact., The hepatitis A vaccine is the best way to prevent HAV infection , CDC has provided outbreak-specific considerations for hepatitis A vaccine administration and has updated its overall recommendations on the prevention of hepatitis A virus infection in the United States., Since the outbreaks were first identified in 2016, 35 states have publicly reported the following as of March 19, 2021, , The risk for person-to-person transmission of HAV continues during the COVID-19 pandemic. The hepatitis A vaccine is the best way to prevent HAV infection. People at risk for acquiring HAV infection or developing serious complications from HAV infection during the current hepatitis A outbreaks should be prioritized to receive the hepatitis A vaccine as soon as it is possible to do so safely., , , NR: not publicly reported, In response to all hepatitis outbreaks, CDC provides ongoing epidemiology and laboratory support as well as support on vaccine supply and vaccine policy development. When requested, CDC sends â€œdisease detectivesâ€ to affected areas to evaluate and assist in an outbreak response. CDC alerts other public health jurisdictions of any increases in disease. All jurisdictions are encouraged to be watchful for increases in hepatitis A cases. CDC also works with state and local health officials to ensure hepatitis A vaccine is targeted to the correct at-risk populations and that supply is adequate., Postexposure prophylaxis (PEP) is recommended for unvaccinated people who have been exposed to hepatitis A virus (HAV) in the last 2 weeks; those with evidence of previous vaccination do not require PEP., PEP consists of:, PEP Recommendations:, NOTE: CDC recommends that all children be vaccinated against hepatitis A at age 1 year. Parents or caregivers who are unsure if a child has been vaccinated should consult the childâ€™s health-care provider to confirm vaccination status., State health departments wanting to submit specimens must contact CDC at hepaoutbreaklab@cdc.gov for approval before shipping specimens to CDC.  Only specimens that that have tested positive for anti-hepatitis A IgM and meet any of the following criteria will be considered., Dear Colleague Letter pdf icon[PDF â€“ 6 MB] from CDC Division of Viral Hepatitis Director regarding Submission of Patient Specimens to CDC for Hepatitis A Testing., CDC is developing educational materials to support the outbreak at the state and local levels. Most materials include an area where local information can be inserted. Your organizationâ€™s contact information can be typed into the blue colored rectangle. To upload your logo, click on the white space below the blue colored rectangle. In the pop-up box, select browse and upload a PDF version of your logo., Fact Sheets, For people who use drugs, Englishpdf iconSpanishpdf icon, For gay and bisexual men, Englishpdf iconSpanishpdf icon, For people experiencing unstable housing or homelessness, Englishpdf iconSpanishpdf icon, For people who are or were recently in jail or prison, Englishpdf iconSpanishpdf icon, Two page visual fact sheet, Englishpdf iconSpanishpdf icon, Pocket Cards, Outbreak hepatitis A Pocket Card â€“ to localize with organization information and outlines who should get vaccinated and the symptoms of hepatitis AEnglishpdf icon  Spanishpdf icon, These cards should be printed double-sided on business card templates that print six double-sided cards per page. Settings must be set to â€œActual sizeâ€ or â€œCustom Scale 100%â€ to ensure accurate alignment., Englishpdf icon  Spanishpdf icon, These cards should be printed double-sided 